import React from "react";

interface UploadButtonProps {
  onUpload: () => void;
}

const UploadButton: React.FC<UploadButtonProps> = ({ onUpload }) => {
  return (
    <button onClick={onUpload} style={{ marginLeft: 8 }}>
      上传文件
    </button>
  );
};

export default UploadButton;
